                    <div className="title">
                        <span>१) सम्झौता गर्ने पक्ष र आयोजना </span>
                        <div className="sub-title">
                            <span>क) उपभोक्ता समितिको विवरण </span>
                            <div className="sub-sub-title">
                                <span>नाम </span> : <input type="text" placeholder="नाम"/>
                            </div>
                            <div className="sub-sub-title">
                                <span>ठेगाना</span> : <input type="text" placeholder="ठेगाना"/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
